import{
  Breadcrumb
}from "react-bootstrap";

class App extends Component {
  render(){
    return (
      <div>
        <Breadcrumb style={{backgroundColor:"orange"}} >
          <Breadcrumb.Item>
            <h1 style={{color:"white"}}>Data Karyawan</h1>
          </Breadcrumb.Item>
        </Breadcrumb>
      </div>
    );
  }
}

export default App;
